import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Parse from 'parse';

const Admin = () => {
  const [isAdmin, setIsAdmin] = useState(false);
  const [adminPass, setAdminPass] = useState('');
  const [courseId, setCourseId] = useState('linux');
  const [formData, setFormData] = useState({ instructor: '', videoLink: '' });

  // Tabs & Enrollments State
  const [activeTab, setActiveTab] = useState('pending');
  const [enrollments, setEnrollments] = useState([]);
  const [loadingEnroll, setLoadingEnroll] = useState(false);

  const checkPass = () => {
    if (adminPass === "snx_admin_2026") setIsAdmin(true);
    else alert("Wrong Password, Agent! âŒ");
  };

  // Data á€†á€½á€²á€‘á€¯á€á€ºá€á€²á€· Function
  const fetchEnrollments = async (statusType) => {
    setLoadingEnroll(true);
    try {
      const query = new Parse.Query("Enrollments");
      query.equalTo("status", statusType);
      query.descending("createdAt");
      const results = await query.find();
      setEnrollments(results);
    } catch (error) {
      console.error("Fetch Error:", error);
    } finally {
      setLoadingEnroll(false);
    }
  };

  // Live Query & Initial Fetch Logic
  useEffect(() => {
    if (isAdmin) {
      fetchEnrollments(activeTab);

      // Setup Live Query Subscription
      let subscription;
      const setupLiveQuery = async () => {
        try {
          const query = new Parse.Query("Enrollments");
          subscription = await query.subscribe();

          // á€€á€»á€±á€¬á€„á€ºá€¸á€žá€¬á€¸á€¡á€žá€…á€º Register á€œá€¯á€•á€ºá€á€¬á€”á€²á€· á€á€”á€ºá€¸á€•á€¼á€™á€šá€º
          subscription.on('create', (object) => {
            console.log("New Mission Received!");
            fetchEnrollments(activeTab);
          });

          // Status á€•á€¼á€±á€¬á€„á€ºá€¸á€žá€½á€¬á€¸á€á€¬á€”á€²á€· (Approve á€–á€¼á€…á€ºá€žá€½á€¬á€¸á€á€¬á€”á€²á€·) á€…á€¬á€›á€„á€ºá€¸ Update á€œá€¯á€•á€ºá€™á€šá€º
          subscription.on('update', () => {
            fetchEnrollments(activeTab);
          });
        } catch (err) {
          console.error("LiveQuery Subscription Error:", err);
        }
      };

      setupLiveQuery();

      // Cleanup subscription on unmount
      return () => {
        if (subscription) subscription.unsubscribe();
      };
    }
  }, [isAdmin, activeTab]);

  const handleApprove = async (objectId) => {
    try {
      const query = new Parse.Query("Enrollments");
      const enrollment = await query.get(objectId);
      enrollment.set("status", "approved");
      await enrollment.save();
      alert("AGENT ACTIVATED! âœ…");
      fetchEnrollments('pending'); // Approve á€•á€¼á€®á€¸á€›á€„á€º pending list á€€á€­á€¯ á€•á€¼á€”á€ºá€…á€…á€ºá€™á€šá€º
    } catch (err) {
      alert("Activation Failed: " + err.message);
    }
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    const Course = Parse.Object.extend("Classes");
    const query = new Parse.Query(Course);
    query.equalTo("courseId", courseId);
    try {
      let obj = await query.first();
      if (!obj) { alert("Class not found!"); return; }
      obj.set("instructor", formData.instructor);
      obj.set("videoLink", formData.videoLink);
      await obj.save();
      alert("Mission Data Updated! âœ…");
    } catch (err) { alert(err.message); }
  };

  if (!isAdmin) return (
    <div style={styles.loginOverlay}>
      <h2 style={{color: '#00ff41', letterSpacing: '3px'}}>[ ADMIN ACCESS REQUIRED ]</h2>
      <input 
        type="password" 
        placeholder="ENTER_ENCRYPTION_KEY" 
        onChange={e => setAdminPass(e.target.value)} 
        style={styles.loginInput} 
      />
      <button onClick={checkPass} style={styles.loginBtn}>ACCESS SYSTEM</button>
    </div>
  );

  return (
    <div style={styles.adminBody}>
      <div style={styles.header}>
        <h1 style={{fontSize: '1.5rem'}}>COMMAND CENTER :: 2026</h1>
        <Link to="/add-class" style={styles.addClassBtn}>+ ADD NEW CLASS</Link>
      </div>

      <div style={styles.gridContainer}>
        {/* LEFT: UPDATE CLASS FORM */}
        <section style={styles.section}>
          <h3 style={styles.sectionTitle}>MODIFY_CLASS_DATA</h3>
          <form onSubmit={handleUpdate} style={styles.form}>
            <select onChange={e => setCourseId(e.target.value)} style={styles.input}>
              <option value="linux">Linux Admin</option>
              <option value="cyber">Cyber Security</option>
              <option value="hacking">World Hacking</option>
              <option value="py_basic">Python Basic</option>
            </select>
            <input placeholder="Instructor Name" onChange={e => setFormData({...formData, instructor: e.target.value})} style={styles.input} />
            <input placeholder="Video Link ID" onChange={e => setFormData({...formData, videoLink: e.target.value})} style={styles.input} />
            <button type="submit" style={styles.updateBtn}>UPDATE MISSION</button>
          </form>
        </section>

        {/* RIGHT: STUDENT MANAGEMENT TABS */}
        <section style={styles.section}>
          <div style={styles.tabHeader}>
            <button 
              onClick={() => setActiveTab('pending')} 
              style={activeTab === 'pending' ? styles.activeTabBtn : styles.tabBtn}
            >
              PENDING ({activeTab === 'pending' ? enrollments.length : '?'})
            </button>
            <button 
              onClick={() => setActiveTab('approved')} 
              style={activeTab === 'approved' ? styles.activeTabBtn : styles.tabBtn}
            >
              APPROVED_LIST
            </button>
          </div>

          <div style={styles.listContainer}>
            {loadingEnroll ? (
              <p style={{color: '#00ff41'}}>SCANNING ENCRYPTED FILES...</p>
            ) : enrollments.length === 0 ? (
              <p style={{color: '#444', textAlign: 'center', marginTop: '20px'}}>NO AGENTS FOUND.</p>
            ) : (
              enrollments.map((item) => (
                <div key={item.id} style={styles.enrollCard}>
                  <div style={{flex: 1}}>
                    <div style={{color: '#00ff41', fontWeight: 'bold'}}>{item.get('studentName')}</div>
                    <div style={{fontSize: '12px', color: '#8892b0'}}>ðŸ“ž {item.get('phoneNumber')}</div>
                    <div style={{fontSize: '11px', color: '#444', marginTop: '5px'}}>
                      Target: {item.get('courseTitle')} | Date: {item.get('createdAt').toLocaleDateString()}
                    </div>
                  </div>
                  {activeTab === 'pending' ? (
                    <button onClick={() => handleApprove(item.id)} style={styles.approveBtn}>APPROVE</button>
                  ) : (
                    <span style={styles.statusBadge}>âœ“ ACTIVE</span>
                  )}
                </div>
              ))
            )}
          </div>
        </section>
